    { name = "django-ninja", specifier = ">=1.3.0" },
    { name = "django-stubs-ext", specifier = ">=5.1.3" },
    { name = "djangorestframework", specifier = ">=3.15.2" },
    { name = "pygments", specifier = ">=2.19.1" },
]

[package.metadata.requires-dev]
dev = [
    { name = "django-stubs", extras = ["compatible-mypy"], specifier = ">=5.1.3" },
    { name = "djangorestframework-stubs", extras = ["compatible-mypy"], specifier = ">=3.15.3" },
    { name = "ruff", specifier = ">=0.11.0" },
    { name = "types-pygments", specifier = ">=2.19.0.20250219" },
]
